import React, {useState, useContext} from 'react'
import { GlobalContext } from '../context/GlobalState';

export const Backtest = ({ backtest }) => {
  const [timeInterval, setTimeInterval] = useState('daily');
  const [seriesType, setSeriesType] = useState('close');

  const { deleteBacktest, current_symbol } = useContext(GlobalContext);

  /*
    ema: function, symbol, interval,time period, series type,
    Sma: function, symbol, interval,time period, series type,
    rsi: function, symbol, interval,time period, series type

    //do below later
    bba: function, symbol, interval,time period, series type, (optionals: dev up, dev down, move avg type)
    MACD:function, symbol, interval, series type, (optional: fastperiod, slow period, signalperiod)
    OBv: function, symbol, interval
    STOCH: function, symbol, interval, (optionals: fast K period, slow K period, slow D period, slow K ma type, slow D ma type)

    pair settings:
    max bags : int
    inital balance: int
    inital bag cost: int or percent
    strategy: selected already... customize the indicator... depending which one, ask user for buy value(-x%)....rebuy delay:int....
    Sell strategy: GAIN... sell profit %

    optional future: trailing buy/sell... stop loss.... DCA system... average bag values(for sell strategy)


  */
  const onSubmit = () => {
    e.preventDefault();
    const calculateThing = { 
      indicator: backtest.indicator,
      symbol: current_symbol, //this kinda optional bc current_symbol is in global state already...
      timeInterval: timeInterval,
      seriesType: seriesType

    };
    console.log(calculateThing);
  }


  switch(backtest.indicator){
    case 'RSI':
      return (
        <li>
          <div className='card col-3'>
            {/* title */}
            {backtest.indicator}
            <form onSubmit={() => onSubmit()}>


              {/* time interval */}
              <label>
                Select Interval:
                <select onChange={(e) => setTimeInterval(e.target.value)}>
                  <option value="daily">Daily</option>
                  <option value="60min">60 minutes</option>
                  <option value="15min">15 minutes</option>
                </select>
              </label>

              {/* series type */}
              <label>
                Select Series Type:
                <select onChange={(e) => setSeriesType(e.target.value)}>
                  <option value="close">close</option>
                  <option value="open">open</option>
                  <option value="high">high</option>
                  <option value="low">low</option>
                </select>
              </label>

              {/* submit button */}
              <button type='submit' className="btn-secondary w-25">Calculate</button>

            </form>

            {/* close button */}
            <button onClick={() => deleteBacktest(backtest.id)} className="btn-primary w-25">x</button>
          </div>
        </li>
      )
    case 'EMA':
      return (
        <li>
          <div className='card col-3'>
            {/* title */}
            {backtest.indicator}
            <form onSubmit={() => onSubmit()}>


              {/* time interval */}
              <label>
                Select Interval:
                <select onChange={(e) => setTimeInterval(e.target.value)}>
                  <option value="daily">Daily</option>
                  <option value="60min">60 minutes</option>
                  <option value="15min">15 minutes</option>
                </select>
              </label>

              {/* series type */}
              <label>
                Select Series Type:
                <select onChange={(e) => setSeriesType(e.target.value)}>
                  <option value="close">close</option>
                  <option value="open">open</option>
                  <option value="high">high</option>
                  <option value="low">low</option>
                </select>
              </label>

              {/* submit button */}
              <button type='submit' className="btn-secondary w-25">Calculate</button>

            </form>

            {/* close button */}
            <button onClick={() => deleteBacktest(backtest.id)} className="btn-primary w-25">x</button>
          </div>
        </li>
      )
    case 'SMA':
      return (
        <li>
          {/* like a div here, has buttons/ parameters... case statement to catch the indicator type and determine return type */}
          {backtest.indicator} 
          <button 
              onClick={() => deleteBacktest(backtest.id)} className="btn-primary">x

          </button>
        </li>
      )
    default:
      return (
        <li>
          default item
          <button 
              onClick={() => deleteBacktest(backtest.id)} className="btn-primary">x
          </button>
        </li>
      )

  }
}
